import i18next from "i18next";
import { initReactI18next } from "react-i18next";

i18next.use(initReactI18next).init({
  resources: {
    en: {
      Services: "Services",
      Strategy: "Strategy",
      "Cases&Clients": "Cases&Clients",
      "About Us": "About Us",
      "Contact and Support": "Contact and Support",
      "Your delivered expectations at just one click away":
        "Your delivered expectations at just one click away",
      "Get Started!": "Get Started!",
      "or get in touch with us": "Or get in touch with us",
    },

    da: {
      translation: {
        Services: "Tjenester",
        Strategy: "Strategi",
        "Cases&Clients": "Sager&Klienter",
        "About Us": "Om os",
        "Contact and Support": "Kontakt og Support",
        "Your delivered expectations at just one click away":
          "Dine leverede forventninger med kun et klik væk",
        "Get Started!": "Kom Igang!",
        "or get in touch with us": "eller kontakt os",
      },
    },
  },

  //   default language
  lang: "en",
});

export default i18next;
